insert  into `post`(`post_id`,`post_judul`,`post_link`,`post_isi`,`post_user`,`post_tanggal`) values (1,'Motto SMK Nusantara Indah','motto-smk-nusantara-indah','<p><strong>Tujuan</strong></p>\n<p>Tujuan SMK Ma\'arif Kota Mungkid dijabarkan berdasarkan tujuan umum pendidikan, visi dan misi sekolah. Berdasarkan tiga hal tersebut, dapat dijabarkan tujuan dari SMK Ma\'arif SMK Nusantara Indah adalah</p>\n<ol>\n<li>Terdepan, Terbaik, dan Terpercaya dalam hal ketakwaan terhadap Tuhan Yang Maha Esa</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam pengembangan potensi, kecerdasan dan minat</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam perolehan Nilai UAN</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam persaingan masuk jenjang Perguruan Tinggi dan Dunia Kerja</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam membekali peserta didik agar memiliki keterampilan teknologi informasi dan komunikasi serta mampu mengembangkan diri secara mandiri.</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam persaingan secara global</li>\n<li>Terdepan, Terbaik dan Terpercaya dalam pelayanan</li>\n</ol>',1,'2013-09-07'),(3,'Visi dan Misi SMK Nusantara Indah','visi-dan-misi-smk-nusantara-indah','<p><strong>Visi Sekolah</strong></p>\n<p>Mencetak tamatan berakhlakul karimah, kompeten, berkarakter dan berdaya saing global.</p>\n<p><strong>Misi Sekolah</strong></p>\n<ol>\n<li>Mengembangkan sikap dan perilaku agamis yang sesuai akidah Ahlusunah wal jama&rsquo;ah.</li>\n<li>Meningkatkan peran sekolah dalam membentuk&nbsp; peserta didik agar mempunyai kompetensi yang dijiwai nilai-nilai budaya dan karakter bangsa.</li>\n<li>Mengembangkan lembaga di lingkungan pendidikan yang berwawasan mutu dan keunggulan, profesional, berorientasi masa depan.</li>\n<li>Menjalin kerja sama yang baik antara sekolah, yayasan, pemerintah dan masyarakat</li>\n<li>Mengutamakan layanan prima dalam upaya pemberdayaan sekolah dan masyarakat.</li>\n</ol>',1,'2013-09-07');

